import React, {Component} from 'react';
import Movies from './components/movies';
import ListGroup from './components/listGroup';

class App extends Component {
  render() {
    return (
      <main className="container">
        <ListGroup />
        <Movies />
      </main>
    )
  }
}

export default App;
